pub fn render<'bump>( &self, bump: &'bump Bump,
) -> Node<'bump> { (Node::Multi(&*bump.alloc_with(|| { [ Node::Text("This is text."), Node::Text("This is also text."), ] })))
}
// ‚Ä¶
# } Note that there is no space between the sentences in the generated HTML. Asteracea gives you fairly precise control over the output, but that also means it won't make changes to the document's whitespace for you. If there's no whitespace in the literal in the input, then there won't be whitespace in the content of the output (when rendering with lignin-html or lignin-dom ). There is one important difference between the HTML and DOM output of adjacent sibling Text nodes: In HTML, it is impossible to distinguish them and browsers will parse them as single DOM node. When manipulating the DOM directly, the distinct text nodes will be preserved. This is one of the reasons that a client-side renderer must once parse the existing DOM into a VDOM when hydrating an app. Another good reason is that user-supplied browser extensions may have made changes to the DOM tree. ( Please don't render into <body> directly! Many browser extensions insert their own scripts or overlays as child elements here. While it's not too likely that these additions will make your app crash, the GUI may glitch and appear for example duplicated. Rendering into, for example, a <div id=app> instead is more reliable.) Multi Nodes generated by Asteracea macros always place their contents in the bump allocation arena, even if those contents are theoretically immutable.

